            if (is_array($log) || is_object($log)) {
                error_log(print_r($log, true));
            } else {
                error_log($log);
            }
        } else {
            ob_start();
            echo '[' . date('d-M-Y h:i:s T') . '] ';
            echo "\r\n";

            if (is_array($log) || is_object($log)) {
                print_r($log);
            } else {
                echo($log);
            }

            echo "\r\n";

            file_put_contents(ABSPATH . 'wp-content/debug.log', ob_get_contents(), FILE_APPEND);
            ob_end_clean();
        }
    }
