{
	int n, m;
	cin >> n >> m;
	vector<int> v1(n), v2(m);
	for(int i = 0; i < n; ++i)
	{
		cin >> v1[i];
	}

	for(int i = 0; i < m; ++i)
	{
		cin >> v2[i];
	}
	sort(v1.begin(), v1.end());
	sort(v2.begin(), v2.end());
	vector<int> tmp;
	set_intersection(v1.begin(), v1.end(),
