class Rectangle:
    def __init__(self, w, h):
        self.width = w
        self.height = h
    
    def perimeter(self):
        return (self.width+self.height)*2

    def area(self):
        return self.width*self.height

    def is_square(self):
        return self.width == self.height

    def __repr__(self):
        name = 'Квадрат' if self.is_square() else 'Прямоугольник'
        return f'{name}({self.width}x{self.height})'
    
