#include <Servo.h>

const int sensorPin = A0;   // Pin del sensor de infrarrojos
const int servoPin = 9;    // Pin del servo
const int stopThreshold = 600;  // Umbral de detección para detener el servo
const int rotateThreshold = 50; // Umbral de detección para girar el servo
const int rotateAngle = 150;  // Ángulo de rotación del servo
const int rotateCenter = 60;

Servo myServo;

void setup() {
  Serial.begin(9600);  // Iniciar comunicación serie
  pinMode(sensorPin, INPUT);
  myServo.attach(servoPin);
  myServo.write(rotateCenter);  // Posición central inicial del servo
}

void loop() {
  int sensorValue = analogRead(sensorPin);
  Serial.print("Lectura del sensor: ");
  Serial.println(sensorValue);

  if (sensorValue > stopThreshold) {
    // Si se detecta un valor mayor al umbral de detención, detener el servo
    myServo.write(rotateCenter);  // Posición central del servo
  } else if (sensorValue < rotateThreshold) {
    // Si detecta color blanco, girar a 90 grados
    Serial.println("BOLA BLANCA");
    myServo.write(rotateAngle);  // Girar a 90 grados
    delay(1000);
    myServo.write(rotateCenter);
  } else {
    // Si detecta color negro, girar a -90 grados
    Serial.println("BOLA NEGRA");
    myServo.write(-rotateAngle);  // Girar a -90 grados
    delay(1000);
    myServo.write(rotateCenter);
  }

  delay(1000);
}

