using namespace std::string_literals;

template <typename Key, typename Value>
class ConcurrentMap {
public:
    static_assert(std::is_integral_v<Key>, "ConcurrentMap supports only integer keys");

    struct Node {
		std::map<Key, Value> map;
		std::mutex mutex;

		std::size_t size() const {
			return map.size();
		}
	};

    struct Access {
        std::lock_guard<std::mutex> guard;  
        Value& ref_to_value;

        Access(std::mutex& g, Value& v): guard(g), ref_to_value(v) {}

        Access(const Key& key, Node& node): guard(node.mutex), ref_to_value(node.map[key]) {}
    };

    explicit ConcurrentMap(size_t bucket_count): nodes_(bucket_count) { 
        if (bucket_count == 0) throw std::invalid_argument("Can't create concurrent map with zero threads"); 
    }

    Access operator[](const Key& key) {
		auto node_iter = FindInNode(key);
		if (node_iter != nodes_.end()) return { key, *node_iter };
		node_iter = GetNextNode();
        total_size_++;
		return { key, *node_iter};
	}

    std::map<Key, Value> BuildOrdinaryMap() {
        std::map<Key, Value> result;
        for (Node& node : nodes_) {
            std::lock_guard map_guard(node.mutex);
            result.insert(node.map.begin(), node.map.end());
            //result.merge(node.map);
        }
        return result;
    }

private:
	
	std::vector<Node> nodes_;
	std::size_t total_size_;

	using MapsIterator = typename std::vector<Node>::iterator;
	using ConstMapsIterator = typename std::vector<Node>::const_iterator;

    MapsIterator GetNextNode() {
        return nodes_.begin() + total_size_ % nodes_.size();
    }

	MapsIterator FindInNode(const Key& key) {
		for (auto iter = nodes_.begin(); iter != nodes_.end(); iter++) {
            std::lock_guard map_mutex(iter->mutex);
            if (iter->map.count(key) > 0) return iter;
		}
		return nodes_.end();
	}
};

using namespace std;

void RunConcurrentUpdates(ConcurrentMap<int, int>& cm, size_t thread_count, int key_count) {
    auto kernel = [&cm, key_count](int seed) {
        vector<int> updates(key_count);
        iota(begin(updates), end(updates), -key_count / 2);
        shuffle(begin(updates), end(updates), mt19937(seed));

        for (int i = 0; i < 2; ++i) {
            for (auto key : updates) {
                ++cm[key].ref_to_value;
                // std::cout << "key: " << key << " updates: " << cm[key].ref_to_value << std::endl;
            }
        }
    };

    vector<future<void>> futures;
    for (size_t i = 0; i < thread_count; ++i) {
        futures.push_back(async(kernel, i));
    }
}

void TestConcurrentUpdate() {
    constexpr size_t THREAD_COUNT = 3;
    constexpr size_t KEY_COUNT = 50000;

    ConcurrentMap<int, int> cm(THREAD_COUNT);
    RunConcurrentUpdates(cm, THREAD_COUNT, KEY_COUNT);

    const auto result = cm.BuildOrdinaryMap();
    ASSERT_EQUAL(result.size(), KEY_COUNT);
    for (auto& [k, v] : result) {
        AssertEqual(v, 6, "Key = " + to_string(k));
    }
}

void TestReadAndWrite() {
    ConcurrentMap<size_t, string> cm(5);

    auto updater = [&cm] {
        for (size_t i = 0; i < 50000; ++i) {
            cm[i].ref_to_value.push_back('a');
        }
    };
    auto reader = [&cm] {
        vector<string> result(50000);
        for (size_t i = 0; i < result.size(); ++i) {
            result[i] = cm[i].ref_to_value;
        }
        return result;
    };

    auto u1 = async(updater);
    auto r1 = async(reader);
    auto u2 = async(updater);
    auto r2 = async(reader);

    u1.get();
    u2.get();

    for (auto f : {&r1, &r2}) {
        auto result = f->get();
        ASSERT(all_of(result.begin(), result.end(), [](const string& s) {
            return s.empty() || s == "a" || s == "aa";
        }));
    }
}

void TestSpeedup() {
    {
        ConcurrentMap<int, int> single_lock(1);

        LOG_DURATION("Single lock");
        RunConcurrentUpdates(single_lock, 4, 50000);
    }
    {
        ConcurrentMap<int, int> many_locks(100);

        LOG_DURATION("100 locks");
        RunConcurrentUpdates(many_locks, 4, 50000);
    }
}

int main() {
    TestRunner tr;
    RUN_TEST(tr, TestConcurrentUpdate);
    RUN_TEST(tr, TestReadAndWrite);
    RUN_TEST(tr, TestSpeedup);
}

